import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Leads from './pages/Leads';
import Login from './pages/Login';

export default function App() {
  return (
    <div>
      <h1>Lead Management App</h1>
    </div>
  );
}

